import React, { Component } from 'react';

class AdminPanel extends Component {
  state = {
    hospitals: [],
    loading: false,
    error: null,
    success: null
  };

  componentDidMount() {
    this.loadHospitals();
  }

  loadHospitals = async () => {
    try {
      this.setState({ loading: true, error: null, success: null });

      const { contract } = this.props;
      const filter = contract.filters.HospitalRegistered();
      const events = await contract.queryFilter(filter, 0, 'latest');
      const hospitalAddresses = events.map(e => e.args.hospital);

      const hospitals = await Promise.all(hospitalAddresses.map(async (addr) => {
        const hospitalData = await contract.hospitals(addr); // returns a struct
        const isAuthorized = await contract.authorizedHospitals(addr);

        return {
          address: addr,
          name: hospitalData[0],           // name
          license: hospitalData[1],        // licenseNumber
          contact: hospitalData[2],        // contactInfo
          isAuthorized
        };
      }));

      this.setState({ hospitals, loading: false });
    } catch (err) {
      console.error('Error loading hospitals:', err);
      this.setState({ error: 'Failed to fetch hospitals.', loading: false });
    }
  };

  toggleAuthorization = async (address, currentStatus) => {
    try {
      const { contract } = this.props;

      this.setState({ loading: true, error: null, success: null });

      const tx = await contract.setHospitalAuthorization(address, !currentStatus);
      await tx.wait();

      this.setState({
        success: `Hospital ${address} is now ${!currentStatus ? 'authorized' : 'unauthorized'}.`
      });

      await this.loadHospitals();
    } catch (err) {
      console.error('Authorization toggle failed:', err);
      this.setState({ error: 'Failed to change hospital status.' });
    } finally {
      this.setState({ loading: false });
    }
  };

  render() {
    const { hospitals, loading, error, success } = this.state;

    return (
      <div className="admin-panel">
        <h2>üëë Admin Panel</h2>
        <p>Manage hospital authorizations</p>

        {loading && <p>‚è≥ Loading hospitals...</p>}
        {error && <p className="error-msg">‚ùå {error}</p>}
        {success && <p className="success-msg">‚úÖ {success}</p>}

        {hospitals.length === 0 && !loading && (
          <p>No hospitals found. Please ensure some are registered.</p>
        )}

        <div className="hospital-list">
          {hospitals.map((h, i) => (
            <div key={i} className="hospital-card">
              <h3>üè• {h.name || 'Unnamed Hospital'}</h3>
              <p><strong>License:</strong> {h.license}</p>
              <p><strong>Contact:</strong> {h.contact}</p>
              <p><strong>Wallet:</strong> <code>{h.address}</code></p>
              <p><strong>Status:</strong> {h.isAuthorized ? '‚úÖ Authorized' : '‚ùå Not Authorized'}</p>

              <button
                onClick={() => this.toggleAuthorization(h.address, h.isAuthorized)}
                className={h.isAuthorized ? 'btn-revoke' : 'btn-approve'}
              >
                {h.isAuthorized ? 'üö´ Revoke Access' : '‚úÖ Authorize'}
              </button>
            </div>
          ))}
        </div>

        <button onClick={this.props.onBack} className="btn-secondary mt-3">
          ‚Üê Back to Dashboard
        </button>
      </div>
    );
  }
}

export default AdminPanel;
